module.exports = {
  parser: '@typescript-eslint/parser',
  parserOptions: {
    ecmaVersion: 2020,
    sourceType: 'module',
  },
  extends: [
    'plugin:@typescript-eslint/recommended',
    'plugin:prettier/recommended',
  ],
  rules: {
    // Forbid "console.debug()" statements.
    'no-console': ['error'],
    '@typescript-eslint/prefer-ts-expect-error': 2,
    '@typescript-eslint/no-explicit-any': 0,
    '@typescript-eslint/explicit-module-boundary-types': 0,
    '@typescript-eslint/ban-ts-comment': 0,
    '@typescript-eslint/no-namespace': [
      2,
      {
        allowDeclarations: true,
      },
    ],
    '@typescript-eslint/no-namespace': 0,
    '@typescript-eslint/no-var-requires': 0,
    '@typescript-eslint/no-unused-vars': [
      2,
      {
        varsIgnorePattern: '^_',
        argsIgnorePattern: '^_',
      },
    ],
  },
  overrides: [
    {
      files: ['**/*.test.ts'],
      rules: {
        'no-console': 'off',
      },
    },
  ],
}

declare module '@bundled-es-modules/cookie' {
  export * as default from 'cookie'
}

declare module '@bundled-es-modules/statuses' {
  import * as statuses from 'statuses'
  export default statuses
}

declare module 'babel-minify' {
  export default function babelMinify(
    code: string,
    opts: Record<string, any>,
    babelOpts: Record<string, any>,
  ): { code: string }
}

